import React, { useState } from 'react';
import { TrendingUp, ShoppingBag, Users, AlertCircle, CheckCircle, MoreHorizontal, ArrowRight } from 'lucide-react';

const AdminDashboard = () => {
  const [activeTab, setActiveTab] = useState('overview');
  
  // Sample data for metrics
  const metrics = {
    revenue: { value: '$2,458.90', change: '+12.5%', positive: true },
    orders: { value: '124', change: '+8.2%', positive: true },
    customers: { value: '86', change: '-3.1%', positive: false },
    avgOrder: { value: '$19.83', change: '+4.3%', positive: true }
  };

  // Sample orders for management
  const pendingOrders = [
    {
      id: "ORD-2025-1235",
      customer: "John Smith",
      date: "March 18, 2025 - 1:23 PM",
      total: 32.97,
      status: "pending",
      items: "3 items"
    },
    {
      id: "ORD-2025-1236",
      customer: "Emma Johnson",
      date: "March 18, 2025 - 1:15 PM",
      total: 47.50,
      status: "preparing",
      items: "5 items"
    },
    {
      id: "ORD-2025-1237",
      customer: "Michael Brown",
      date: "March 18, 2025 - 1:08 PM",
      total: 24.99,
      status: "ready",
      items: "2 items"
    }
  ];

  const getStatusClass = (status) => {
    switch (status) {
      case 'pending': return 'status-pending';
      case 'preparing': return 'status-preparing';
      case 'ready': return 'status-ready';
      case 'delivered': return 'status-delivered';
      default: return '';
    }
  };

  const getStatusIcon = (status) => {
    switch (status) {
    //   case 'pending': return <Clock size={16} />;
      case 'preparing': return <MoreHorizontal size={16} />;
      case 'ready': return <ArrowRight size={16} />;
      case 'delivered': return <CheckCircle size={16} />;
      default: return null;
    }
  };

  return (
    <div className="fade-in">
      <h2 className="text-2xl font-bold text-gray-800 mb-6">Admin Dashboard</h2>
      
      {/* Tabs */}
      <div className="border-b border-gray-200 mb-6">
        <nav className="flex space-x-8">
          <button
            onClick={() => setActiveTab('overview')}
            className={`py-4 px-1 border-b-2 font-medium text-sm ${
              activeTab === 'overview'
                ? 'border-red-600 text-red-600'
                : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
            }`}
          >
            Overview
          </button>
          <button
            onClick={() => setActiveTab('orders')}
            className={`py-4 px-1 border-b-2 font-medium text-sm ${
              activeTab === 'orders'
                ? 'border-red-600 text-red-600'
                : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
            }`}
          >
            Orders
          </button>
          <button
            onClick={() => setActiveTab('menu')}
            className={`py-4 px-1 border-b-2 font-medium text-sm ${
              activeTab === 'menu'
                ? 'border-red-600 text-red-600'
                : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
            }`}
          >
            Menu Management
          </button>
          <button
            onClick={() => setActiveTab('users')}
            className={`py-4 px-1 border-b-2 font-medium text-sm ${
              activeTab === 'users'
                ? 'border-red-600 text-red-600'
                : 'border-transparent text-gray-500 hover:text-gray-700 hover:border-gray-300'
            }`}
          >
            User Management
          </button>
        </nav>
      </div>
      
      {/* Tab Content */}
      {activeTab === 'overview' && (
        <div>
          {/* Metrics */}
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
            <div className="bg-white p-6 rounded-lg shadow">
              <div className="flex items-center justify-between">
                <div>
                  <p className="text-sm font-medium text-gray-600">Today's Revenue</p>
                  <p className="text-2xl font-semibold text-gray-900">{metrics.revenue.value}</p>
                </div>
                <div className={`p-3 rounded-full ${metrics.revenue.positive ? 'bg-green-100' : 'bg-red-100'}`}>
                  <TrendingUp size={24} className={metrics.revenue.positive ? 'text-green-600' : 'text-red-600'} />
                </div>
              </div>
              <p className={`mt-2 flex items-center text-sm ${metrics.revenue.positive ? 'text-green-600' : 'text-red-600'}`}>
                <span>{metrics.revenue.change}</span>
                <span className="text-gray-500 ml-2">from yesterday</span>
              </p>
            </div>
            
            <div className="bg-white p-6 rounded-lg shadow">
              <div className="flex items-center justify-between">
                <div>
                  <p className="text-sm font-medium text-gray-600">Orders</p>
                  <p className="text-2xl font-semibold text-gray-900">{metrics.orders.value}</p>
                </div>
                <div className={`p-3 rounded-full ${metrics.orders.positive ? 'bg-green-100' : 'bg-red-100'}`}>
                  <ShoppingBag size={24} className={metrics.orders.positive ? 'text-green-600' : 'text-red-600'} />
                </div>
              </div>
              <p className={`mt-2 flex items-center text-sm ${metrics.orders.positive ? 'text-green-600' : 'text-red-600'}`}>
                <span>{metrics.orders.change}</span>
                <span className="text-gray-500 ml-2">from yesterday</span>
              </p>
            </div>
            
            <div className="bg-white p-6 rounded-lg shadow">
              <div className="flex items-center justify-between">
                <div>
                  <p className="text-sm font-medium text-gray-600">New Customers</p>
                  <p className="text-2xl font-semibold text-gray-900">{metrics.customers.value}</p>
                </div>
                <div className={`p-3 rounded-full ${metrics.customers.positive ? 'bg-green-100' : 'bg-red-100'}`}>
                  <Users size={24} className={metrics.customers.positive ? 'text-green-600' : 'text-red-600'} />
                </div>
              </div>
              <p className={`mt-2 flex items-center text-sm ${metrics.customers.positive ? 'text-green-600' : 'text-red-600'}`}>
                <span>{metrics.customers.change}</span>
                <span className="text-gray-500 ml-2">from yesterday</span>
              </p>
            </div>
            
            <div className="bg-white p-6 rounded-lg shadow">
              <div className="flex items-center justify-between">
                <div>
                  <p className="text-sm font-medium text-gray-600">Avg. Order Value</p>
                  <p className="text-2xl font-semibold text-gray-900">{metrics.avgOrder.value}</p>
                </div>
                <div className={`p-3 rounded-full ${metrics.avgOrder.positive ? 'bg-green-100' : 'bg-red-100'}`}>
                  <TrendingUp size={24} className={metrics.avgOrder.positive ? 'text-green-600' : 'text-red-600'} />
                </div>
              </div>
              <p className={`mt-2 flex items-center text-sm ${metrics.avgOrder.positive ? 'text-green-600' : 'text-red-600'}`}>
                <span>{metrics.avgOrder.change}</span>
                <span className="text-gray-500 ml-2">from yesterday</span>
              </p>
            </div>
          </div>
          
          {/* Recent Orders */}
          <div className="bg-white shadow rounded-lg overflow-hidden mb-8">
            <div className="px-6 py-4 border-b border-gray-200">
              <h3 className="text-lg font-medium text-gray-900">Recent Orders</h3>
            </div>
            <div className="overflow-x-auto">
              <table className="min-w-full divide-y divide-gray-200">
                <thead className="bg-gray-50">
                  <tr>
                    <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Order ID
                    </th>
                    <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Customer
                    </th>
                    <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Date
                    </th>
                    <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Amount
                    </th>
                    <th scope="col" className="px-6 py-3 text-left text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Status
                    </th>
                    <th scope="col" className="px-6 py-3 text-right text-xs font-medium text-gray-500 uppercase tracking-wider">
                      Actions
                    </th>
                  </tr>
                </thead>
                <tbody className="bg-white divide-y divide-gray-200">
                  {pendingOrders.map((order) => (
                    <tr key={order.id}>
                      <td className="px-6 py-4 whitespace-nowrap text-sm font-medium text-gray-900">
                        {order.id}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                        {order.customer}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                        {order.date}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-sm text-gray-500">
                        ${order.total.toFixed(2)}
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap">
                        <span className={`${getStatusClass(order.status)} inline-flex items-center gap-1`}>
                          {getStatusIcon(order.status)}
                          {order.status.charAt(0).toUpperCase() + order.status.slice(1)}
                        </span>
                      </td>
                      <td className="px-6 py-4 whitespace-nowrap text-right text-sm font-medium">
                        <button className="text-red-600 hover:text-red-800">View</button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
            <div className="px-6 py-4 border-t border-gray-200">
              <button className="text-sm font-medium text-red-600 hover:text-red-800">View all orders â†’</button>
            </div>
          </div>
        </div>
      )}
      
      {activeTab === 'orders' && (
        <div className="bg-white shadow rounded-lg p-6">
          <h3 className="text-lg font-medium text-gray-900 mb-6">Order Management</h3>
          <p className="text-gray-600">This section would contain a full order management interface with filtering, searching, and order processing capabilities.</p>
        </div>
      )}
      
      {activeTab === 'menu' && (
        <div className="bg-white shadow rounded-lg p-6">
          <h3 className="text-lg font-medium text-gray-900 mb-6">Menu Management</h3>
          <p className="text-gray-600">This section would contain interfaces for adding, editing, and removing menu items, managing categories, and setting pricing.</p>
        </div>
      )}
      
      {activeTab === 'users' && (
        <div className="bg-white shadow rounded-lg p-6">
          <h3 className="text-lg font-medium text-gray-900 mb-6">User Management</h3>
          <p className="text-gray-600">This section would contain interfaces for managing customers, staff accounts, and permissions.</p>
        </div>
      )}
    </div>
  );
};

export default AdminDashboard;
